import React from "react";
import resume from "../components/assets/Daphne_Wu_Resume1.pdf";

const Resume = () => (
    <div className="h-screen flex justify-center items-center">
      {/* Embed the PDF cleanly with no extra controls */}
      <embed 
        src={resume}  // Path to your PDF file in the public folder
        width="100%" 
        height="100%" 
        type="application/pdf"
      />
      {/* Download link */}
      <a
        href={resume} // Path to your PDF file
        download="resume.pdf"      // Suggested filename for download
        className="absolute bottom-10 text-white bg-blue-500 px-6 py-3 rounded-lg hover:bg-blue-600 transition"
      >
        Download Resume
      </a>
    </div>
  );

export default Resume;
